import React from 'react'
import { IconHeader, HeaderTextContainer, ProfileContainer, ProfileImageContainer } from '../lib/container'
import { Icon } from '../lib/icons'

export const Header = () => {

  return (
    <IconHeader>
      <Icon src='/assets/linkedin-white-mobile.svg' alt='linkedin' href='https://www.linkedin.com/in/jihyun-an-405431150/' />
    </IconHeader>
  )
}

export default Header
